import React from 'react';


function Food(props) {
  console.log(props);

  return (
    <h3>
      I like {props.name}. <br></br>
      <img src={props.img} style={{width: "150px", height: "150px"}}></img>

    </h3>
  );
}

const foodList = [
  {
    name: "food1",
    image: "https://www.pikpng.com/pngl/m/74-745720_download-img-icon-png-clipart.png"
  },
  {
    name: "food2",
    image: "https://www.pikpng.com/pngl/m/74-745720_download-img-icon-png-clipart.png"
  },
  {
    name: "food3",
    image: "https://www.pikpng.com/pngl/m/74-745720_download-img-icon-png-clipart.png"
  }
]

function App() {
  return (
    <div className="App">
      {foodList.map(el => <Food name={el.name} img={el.image}/>)}
    </div>
  );
}


export default App;
